var iOS = false, p = navigator.platform;
if( p === 'iPad' || p === 'iPhone' || p === 'iPod' ){
    iOS = true;
}
function winHeight() {
    winheight = $(window).height();
    $('.winheight').css('height',winheight+'px');
    halfwinheight = $(window).height()/2;
    $('.halfwinheight').css('height',halfwinheight+'px');
}
function resize() {
    winwidth = $(window).width();
    if (winwidth <= 920) {
        $('#menutoggle').css('display','none');
    } else {
        $('#menutoggle').css('display','block');
        $('#toggle').removeClass('open');
    }
    winHeight();
}
if (iOS == true) {
} else {
    $(window).resize(function() {
        resize();
    });
}
$(window).load(function() {
    resize();
});
$(document).ready(function(){
    $('#toggle').click(function(){
        $(this).toggleClass('open');
        if($('#menutoggle').css('display') == 'none') {
            $('#menutoggle').css('display','block');
        } else {
            $('#menutoggle').css('display','none');
        }
    });
    winHeight();
});
$('.topLink').click(function() {
    $("html, body").animate({ scrollTop: 0 }, "slow");
    return false;
});
var $win = $(window).scroll(function() {
    if($win.scrollTop() > 200) {
        $('.topLink').css('display','block');
    } else {
        $('.topLink').css('display','none');
    }
});

